INSERT INTO `dg_products` VALUES (1,'t-shirt','t-shirt-sdf-asf','<h1 style=\"box-sizing: border-box; margin: 0px 0px 20px; color: #747474; font-family: \'PT Sans\',Arial,Helvetica,sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 22px; text-align: center; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; background-color: #ffffff;\"><strong>H3 dfsdf sfsd</strong></h1>\r\n<h2 style=\"box-sizing: border-box; margin: 0px 0px 20px; color: #747474; font-family: \'PT Sans\', Arial, Helvetica, sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 22px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff;\">The Short Military Jacket is based on an actual piece from the Barbour archive, customised by the original Department B for a pilot serving in the Falklands war. Originally a traditional country jacket, this heavily customised piece was tailored to meet the exact needs of a pilot within the parachute regiment with strategically placed reinforcements and a whole host of utilitarian pockets added to the jacket purely for practical purposes. Where he needed a pocket for ammunition, they added one. An incredible piece of design, the Short Military Jacket is evidence of the ethos of Dept. (B) and of Barbour as a whole, practicality is paramount and needs must.</h2>\r\n<ul class=\"fusion-checklist\" style=\"box-sizing: border-box; list-style-type: none; padding: 0px; margin: 10px 0px 0px; color: #747474; font-family: \'PT Sans\', Arial, Helvetica, sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 22px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff;\">\r\n<li class=\"fusion-li-item size-small\" style=\"box-sizing: border-box; margin-bottom: 11px; font-size: 13px; line-height: 21px;\">\r\n<div class=\"fusion-li-item-content\" style=\"box-sizing: border-box; display: block; margin-left: 30px;\">Cotton Construction</div>\r\n</li>\r\n<li class=\"fusion-li-item size-small\" style=\"box-sizing: border-box; margin-bottom: 11px; font-size: 13px; line-height: 21px;\">\r\n<div class=\"fusion-li-item-content\" style=\"box-sizing: border-box; display: block; margin-left: 30px;\">70/30 Acrylic/Wool Lining</div>\r\n</li>\r\n<li class=\"fusion-li-item size-small\" style=\"box-sizing: border-box; margin-bottom: 11px; font-size: 13px; line-height: 21px;\">\r\n<div class=\"fusion-li-item-content\" style=\"box-sizing: border-box; display: block; margin-left: 30px;\">Strategically Placed, Utilitarian Pockets</div>\r\n</li>\r\n<li class=\"fusion-li-item size-small\" style=\"box-sizing: border-box; margin-bottom: 11px; font-size: 13px; line-height: 21px;\">\r\n<div class=\"fusion-li-item-content\" style=\"box-sizing: border-box; display: block; margin-left: 30px;\">Reinforced Elbows</div>\r\n</li>\r\n<li class=\"fusion-li-item size-small\" style=\"box-sizing: border-box; margin-bottom: 11px; font-size: 13px; line-height: 21px;\">\r\n<div class=\"fusion-li-item-content\" style=\"box-sizing: border-box; display: block; margin-left: 30px;\">Vented Yoke</div>\r\n</li>\r\n<li class=\"fusion-li-item size-small\" style=\"box-sizing: border-box; margin-bottom: 11px; font-size: 13px; line-height: 21px;\">\r\n<div class=\"fusion-li-item-content\" style=\"box-sizing: border-box; display: block; margin-left: 30px;\"><strong>Original Functional Details</strong></div>\r\n</li>\r\n<li class=\"fusion-li-item size-small\" style=\"box-sizing: border-box; margin-bottom: 11px; font-size: 13px; line-height: 21px;\">\r\n<div class=\"fusion-li-item-content\" style=\"box-sizing: border-box; display: block; margin-left: 30px;\">Double Stud Placket</div>\r\n</li>\r\n<li class=\"fusion-li-item size-small\" style=\"box-sizing: border-box; margin-bottom: 11px; font-size: 13px; line-height: 21px;\">\r\n<div class=\"fusion-li-item-content\" style=\"box-sizing: border-box; display: block; margin-left: 30px;\">Adjustable Hood, Hem and Cuffs</div>\r\n</li>\r\n</ul>','The relaxed fit t-shirt for women has a narrow neck rib, tailored sleeves and a redesigned cut for a better ladies fit. With plenty of extra room, this shirt is ideal for most body types. The fabric is made from 100% pre-shrunk cotton (deep heather is 50% cotton/50%polyester) and has a fabric weight of 5.4 oz.','<p><img src=\"media/assets/size,width130,height130.png\" alt=\"\" /></p>\r\n<table style=\"height: 99px;\" width=\"581\">\r\n<tbody>\r\n<tr>\r\n<td style=\"text-align: left;\"><strong>&nbsp;Size</strong></td>\r\n<td style=\"text-align: center;\"><strong>S</strong></td>\r\n<td style=\"text-align: center;\"><strong>M</strong></td>\r\n<td style=\"text-align: center;\"><strong>L</strong></td>\r\n<td style=\"text-align: center;\"><strong>XL</strong></td>\r\n<td style=\"text-align: center;\"><strong>XXL</strong></td>\r\n<td style=\"text-align: center;\"><strong>XXXL</strong></td>\r\n</tr>\r\n<tr>\r\n<td><span style=\"color: #404040; font-family: \'Helvetica Neue\', Arial, Helvetica, Corbel, Calibri, \'Trebuchet MS\', sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 21px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; display: inline !important; float: none; background-color: #ffffff;\">&nbsp;Measure A (inch)</span></td>\r\n<td style=\"text-align: center;\">&nbsp;<span style=\"color: #404040; font-family: \'Helvetica Neue\', Arial, Helvetica, Corbel, Calibri, \'Trebuchet MS\'